import React, {useEffect, useState} from "react";
import Artist from "./Artist";


function ArtistsContainer() {
  const [artists, setArtistList] = useState([]);
    useEffect(() => {
    fetch('http://http://localhost:9292/artists')
    .then(res => res.json())
    .then(artistsData => {
      setArtistList(artistsData)
      });
  }, []);


  const artistsCard = artists.map( (artists)=> (<Artist key={artists.id}  pName={artists.name} pCity={artists.city}  pImage_link={artists.image_link} pGenres={artists.genres}/>))


  return (
    <div class="container-fluid" className="artists-container">
     {artistsCard}
    </div>
  );
}

export default ArtistsContainer;
